import React from "react";
const array = [
  {
    type: "Stays",
    icon: "fa-bed",
    active: true,
  },
  {
    type: "Flights",
    icon: "fa-plane",
    active: false,
  },
  {
    type: "Car rentals",
    icon: "fa-car",
    active: false,
  },
  {
    type: "Attractions",
    icon: "fa-bed",
    active: false,
  },
  {
    type: "Airport taxis",
    icon: "fa-taxi",
    active: false,
  },
];
const NavBar = array.map((props, index) => {
  console.log(props);
  return (
    <>
      <div key={props.index}>
        <div>{props.type}</div>
        <></>
        <span>{props.icon}</span>
      </div>
    </>
  );
});

export default NavBar;
